export default class s{intervalId=0;constructor({seconds:s,minutes:t}){this.seconds=s,this.minutes=t}start(){self=this,self.intervalId=setInterval(()=>{if(59!==self.seconds){self.seconds++;return}self.minutes++,self.seconds=0},1e3)}stop(){clearInterval(this.intervalId)}reset(){this.stop(),self=this,self.seconds=0,self.minutes=0}};